import{_ as e,o as t,c as a,Q as o}from"./chunks/framework.ec8f7e8e.js";const _=JSON.parse('{"title":"What is OSC Proximity Chat","description":"","frontmatter":{},"headers":[],"relativePath":"guide/what-is-proximity.md","filePath":"guide/what-is-proximity.md"}'),i={name:"guide/what-is-proximity.md"},r=o('<h1 id="what-is-osc-proximity-chat" tabindex="-1">What is OSC Proximity Chat <a class="header-anchor" href="#what-is-osc-proximity-chat" aria-label="Permalink to &quot;What is OSC Proximity Chat&quot;">​</a></h1><p>OSC (Open Source Club&#39;s) Proximity Chat App is a <em>in development</em> mobile social networking app. The app aims to allow easy communication between users within a certain distance between each other. Our app singles your experience down to only a few hundred meters from you. That means everything and anything you see or post is relevant to your current location.</p><h2 id="our-plans" tabindex="-1">Our Plans <a class="header-anchor" href="#our-plans" aria-label="Permalink to &quot;Our Plans&quot;">​</a></h2><p>We started the planning and development of OSC Proximity Chat around September 2023. The <strong>MVP</strong> (Minimum Viable Product) is scheduled to be completed by the start of Spring semester 2024. If you are interested in learning more about the app, please join the <a href="https://discord.gg/CedfucmXbq" target="_blank" rel="noreferrer">Open Source Club discord</a> and message us in the #echologator channel!</p>',4),n=[r];function s(h,c,p,d,l,m){return t(),a("div",null,n)}const y=e(i,[["render",s]]);export{_ as __pageData,y as default};
